import React, { Component } from "react";

class Results extends Component {

    state = {
        correct: [],
        wrong: []
    };

    correctArray = (event) => {
        event.preventDefault();

    };

    render() {
        return (

            <div className="masterResultsDiv">

                <div>
                    correct
                </div>

                <div>
                    wrong
                </div>

            </div>

        )
    }




}

export default Results;
